import { Outlet } from "react-router-dom";
import EventsNavigation from "../components/EventsNavigation";
import MainNavigation from "../components/MainNavigation";

function Root() {
  return (
    <>
      <MainNavigation />
      <main>
        <Outlet />
      </main>
    </>
  );
}

export function RootEvents() {
  <>
    <EventsNavigation />
    <main>
      <Outlet />
    </main>
  </>;
}

export default Root;
